Summer's Blood (2009)  

Canada
Thriller / Horror

geregisseerd door Lee Demarbre
met Ashley Greene, Barbara Niven en Peter Mooney

Wanneer de tiener Summer (Ashley Greene) erachter komt dat haar moeder gelogen heeft over het feit wie haar vader is, wil ze haar vader opzoeken. Haar enige aanwijziging is een brief, die afgestempeld is in een klein stadje, genaamd Massey. Wanneer ze hier eenmaal is aangekomen, wordt ze door een man, genaamd Tom, gered van een conflict met de wet. Samen vluchten ze en ze zoeken het huis van Tom op, waar haar zoektocht naar haar vader al snel wordt afgebroken en verandert in een duistere nachtmerrie...

